Ext.data.JsonP.Ext_app_module_Module({"parentMixins":[],"singleton":false,"statics":{"cfg":[],"property":[],"method":[{"owner":"Ext.Base","meta":{"static":true},"tagname":"method","name":"addMembers","id":"static-method-addMembers"},{"owner":"Ext.Base","meta":{"static":true},"tagname":"method","name":"addStatics","id":"static-method-addStatics"},{"owner":"Ext.Base","meta":{"private":true,"static":true},"tagname":"method","name":"borrow","id":"static-method-borrow"},{"owner":"Ext.Base","meta":{"static":true},"tagname":"method","name":"create","id":"static-method-create"},{"owner":"Ext.Base","meta":{"static":true},"tagname":"method","name":"createAlias","id":"static-method-createAlias"},{"owner":"Ext.Base","meta":{"static":true},"tagname":"method","name":"getName","id":"static-method-getName"},{"owner":"Ext.Base","meta":{"markdown":true,"deprecated":{"text":"{Ext_Base:method-override:deprecated}"},"static":true},"tagname":"method","name":"override","id":"static-method-override"}],"event":[],"css_var":[],"css_mixin":[]},"html":"<div><pre class=\"hierarchy\"><h4>Hierarchy</h4><div class='subclass first-child'><a href='#!/api/Ext.Base' rel='Ext.Base' class='docClass'>Ext.Base</a><div class='subclass '><strong>Ext.app.module.Module</strong></div></div><h4>Files</h4><div class='dependency'><a href='source/Module.html#Ext-app-module-Module' target='_blank'>Module.js</a></div></pre><div class='doc-contents'><p><p>Ext Server MVC の Modelを構成するクラスです。</p>\n\n<p>Ext ServeではModuleと呼びます。</p></p>\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-cfg'>Config options</h3><div class='subsection'><div id='cfg-autoConnect' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-cfg-autoConnect' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-cfg-autoConnect' class='name expandable'>autoConnect</a><span> : String</span></div><div class='description'><div class='short'><p>このクラスが初期化されるときに自動的に接続するかどうかを指定します。</p> ...</div><div class='long'><p><p>このクラスが初期化されるときに自動的に接続するかどうかを指定します。</p></p>\n<p>デフォルトは: <code>true</code></p></div></div></div><div id='cfg-connName' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-cfg-connName' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-cfg-connName' class='name expandable'>connName</a><span> : String</span></div><div class='description'><div class='short'><p>このクラスが使用するコネクションの名前を指定します。</p> ...</div><div class='long'><p><p>このクラスが使用するコネクションの名前を指定します。</p></p>\n<p>デフォルトは: <code>&quot;default&quot;</code></p></div></div></div><div id='cfg-useTable' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-cfg-useTable' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-cfg-useTable' class='name expandable'>useTable</a><span> : String</span></div><div class='description'><div class='short'><p>使用するテーブル名を指定します。</p> ...</div><div class='long'><p><p>使用するテーブル名を指定します。</p></p>\n<p>デフォルトは: <code>null</code></p></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-self' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-property-self' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-property-self' class='name not-expandable'>self</a><span> : <a href=\"#!/api/Ext.Class\" rel=\"Ext.Class\" class=\"docClass\">Ext.Class</a></span><strong class='protected signature'>protected</strong></div><div class='description'><div class='short'><p><p>現在のクラス定義へアクセスするオブジェクトを取得します。</p></p>\n</div><div class='long'><p><p>現在のクラス定義へアクセスするオブジェクトを取得します。\n<a href=\"#!/api/Ext.Base-method-statics\" rel=\"Ext.Base-method-statics\" class=\"docClass\" >statics</a>,\nとは違い、<code>this.self</code>スコープに依存し、動的な継承に利用されます。\n<a href=\"#!/api/Ext.Base-method-statics\" rel=\"Ext.Base-method-statics\" class=\"docClass\" >statics</a>,\nを参照して違いを確認してください。</p>\n\n<pre><code>Ext.define('My.Cat', {\n    statics: {\n        speciesName: 'Cat' // My.Cat.speciesName = 'Cat'\n    },\n\n    constructor: function() {\n        alert(this.self.speciesName); // dependent on 'this'\n    },\n\n    clone: function() {\n        return new this.self();\n    }\n});\n\n\nExt.define('My.SnowLeopard', {\n    extend: 'My.Cat',\n    statics: {\n        speciesName: 'Snow Leopard'         // My.SnowLeopard.speciesName = 'Snow Leopard'\n    }\n});\n\nvar cat = new My.Cat();                     // alerts 'Cat'\nvar snowLeopard = new My.SnowLeopard();     // alerts 'Snow Leopard'\n\nvar clone = snowLeopard.clone();\nalert(Ext.getClassName(clone));             // alerts 'My.SnowLeopard'\n</code></pre></p>\n</div></div></div></div></div><div class='members-section'><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div class='definedBy'>Defined By</div><h4 class='members-subtitle'>Instance Methods</h3><div id='method-S-onExtended' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-S-onExtended' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-S-onExtended' class='name expandable'>$onExtended</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-addConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-addConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-addConfig' class='name expandable'>addConfig</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-addInheritableStatics' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-addInheritableStatics' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-addInheritableStatics' class='name expandable'>addInheritableStatics</a>( <span class='pre'>Object members</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>members</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-addMember' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-addMember' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-addMember' class='name expandable'>addMember</a>( <span class='pre'>Object name, Object member</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>member</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-beginTrans' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-beginTrans' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-beginTrans' class='name expandable'>beginTrans</a>( <span class='pre'>Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL</p>\n\n<p>トランザクションを開始します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-callParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-callParent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-callParent' class='name expandable'>callParent</a>( <span class='pre'>Array/Arguments args</span> ) : Object<strong class='protected signature'>protected</strong></div><div class='description'><div class='short'><p>現在のメソッドの\"親の\"メソッドをコールします。</p> ...</div><div class='long'><p><p>現在のメソッドの\"親の\"メソッドをコールします。\n派生やオーバーライドによって上書きされる前の状態のメソッドをコールします。\n(<a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" class=\"docClass\" >Ext.define</a>\nを参照)</p>\n\n<pre><code> Ext.define('My.Base', {\n     constructor: function(x) {\n         this.x = x;\n     },\n\n     statics: {\n         method: function(x) {\n             return x;\n         }\n     }\n });\n\n Ext.define('My.Derived', {\n     extend: 'My.Base',\n\n     constructor: function() {\n         this.callParent([21]);\n     }\n });\n\n var obj = new My.Derived();\n\n alert(obj.x);  // alerts 21\n</code></pre>\n\n<p>これは次のようにオーバーライドできます。</p>\n\n<pre><code> Ext.define('My.DerivedOverride', {\n     override: 'My.Derived',\n\n     constructor: function(x) {\n         this.callParent([x*2]); // オリジナルのMy.Derivedのconstructorを呼び出す\n     }\n });\n\n var obj = new My.Derived();\n\n alert(obj.x);  // now alerts 42\n</code></pre>\n\n<p>また、静的メソッドでも動作します。</p>\n\n<pre><code> Ext.define('My.Derived2', {\n     extend: 'My.Base',\n\n     statics: {\n         method: function(x) {\n             return this.callParent([x*2]); // My.Base.methodを呼び出す\n         }\n     }\n });\n\n alert(My.Base.method(10);     // alerts 10\n alert(My.Derived2.method(10); // alerts 20\n</code></pre>\n\n<p>静的メソッドをオーバーライドしても動作します。</p>\n\n<pre><code> Ext.define('My.Derived2Override', {\n     override: 'My.Derived2',\n\n     statics: {\n         method: function(x) {\n             return this.callParent([x*2]); // My.Derived2.methodを呼び出す\n         }\n     }\n });\n\n alert(My.Derived2.method(10); // now alerts 40\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>args</span> : Array/Arguments<div class='sub-desc'><p><p>引数。配列または、現在のメソッドの<code>arguments</code>オブジェクト。 \n例: <code>this.callParent(arguments)</code></p></p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p></p>\n</div></li></ul></div></div></div><div id='method-commit' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-commit' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-commit' class='name expandable'>commit</a>( <span class='pre'>Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL</p>\n\n<p>現在のトランザクションをコミットします。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-createCollection' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-createCollection' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-createCollection' class='name expandable'>createCollection</a>( <span class='pre'>Object name, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>新しいコレクションを作成します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'><p><p>コレクションの名前</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-createDatabase' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-createDatabase' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-createDatabase' class='name expandable'>createDatabase</a>( <span class='pre'>Object name, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>新しいデータベースを作成します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'><p><p>データベースの名前</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-dropCollection' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-dropCollection' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-dropCollection' class='name expandable'>dropCollection</a>( <span class='pre'>Object name, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>既存のコレクションを削除します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'><p><p>コレクションの名前</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-dropDatabase' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-dropDatabase' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-dropDatabase' class='name expandable'>dropDatabase</a>( <span class='pre'>Object name, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>既存のデータベースを削除します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'><p><p>データベースの名前</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-end' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-end' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-end' class='name expandable'>end</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>MySQL使用時、クエリー実行後、任意のタイミングでこのメソッドを呼び出す必要があります。</p> ...</div><div class='long'><p><p>MySQL使用時、クエリー実行後、任意のタイミングでこのメソッドを呼び出す必要があります。\nそうしないと、コネクションがクローズしません。</p>\n\n<p>例:</p>\n\n<pre><code>lastId: function (cb) {\n    var me = this;\n\n    me.query('SELECT LAST_INSERT_ID()', function(err, ret) {\n        me.end();\n        cb(ret);\n    });\n}\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p>{Ext_app_module_Module:method-end:param_o}</p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p>{Ext_app_module_Module:method-end:param_fn}</p>\n</div></li></ul></div></div></div><div id='method-extend' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-extend' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-extend' class='name expandable'>extend</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-find' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-find' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-find' class='name expandable'>find</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL, MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL, MongoDB</p>\n\n<p>テーブル/コレクションから指定した条件のレコード/ドキュメントを取り出します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p><strong>MySQL</strong>:\nwhere句を入れた文字列、またはキー／値ペアの抽出条件を指定します。</p>\n\n<p><strong>MongoDB</strong>:\nqueryパラメーターを指定します。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-findAndModify' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-findAndModify' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-findAndModify' class='name expandable'>findAndModify</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>ドキュメントを検索して更新しその値を返します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p>MongoDBのfindAndModifyコマンドに渡すオブジェクトを指定します。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-getConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-getConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-getConfig' class='name expandable'>getConfig</a>( <span class='pre'>Object name</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getInitialConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-getInitialConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-getInitialConfig' class='name expandable'>getInitialConfig</a>( <span class='pre'>Object name</span> )</div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-hasConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-hasConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-hasConfig' class='name expandable'>hasConfig</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-implement' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-implement' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-implement' class='name expandable'>implement</a>( <span class='pre'></span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n</div></div></div><div id='method-init' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-init' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-init' class='name expandable'>init</a>( <span class='pre'>Object config, Object next</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>next</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-initConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-initConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-initConfig' class='name expandable'>initConfig</a>( <span class='pre'>Object config</span> ) : Object<strong class='protected signature'>protected</strong></div><div class='description'><div class='short'><p>コンフィグを初期化します。良くある例:</p> ...</div><div class='long'><p><p>コンフィグを初期化します。良くある例:</p>\n\n<pre><code>Ext.define('My.awesome.Class', {\n    // The default config\n    config: {\n        name: 'Awesome',\n        isAwesome: true\n    },\n\n    constructor: function(config) {\n        this.initConfig(config);\n    }\n});\n\nvar awesome = new My.awesome.Class({\n    name: 'Super Awesome'\n});\n\nalert(awesome.getName()); // 'Super Awesome'\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'><p></p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p><p>キー／値のプロトタイプ。</p></p>\n</div></li></ul></div></div></div><div id='method-insert' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-insert' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-insert' class='name expandable'>insert</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>テーブル/コレクションに新しいレコード/ドキュメントを挿入します。</p> ...</div><div class='long'><p><p>テーブル/コレクションに新しいレコード/ドキュメントを挿入します。</p>\n\n<p><strong>対象</strong>: MySQL, MongoDB</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p>挿入するオブジェクト。</p>\n\n<p><strong>MySQL</strong>:\n挿入するレコードをキー／値ペアで指定します。</p>\n\n<p><strong>MongoDB</strong>:\nMongoDBのinsertコマンドに渡すオブジェクトを指定します。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-mixin' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-mixin' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-mixin' class='name expandable'>mixin</a>( <span class='pre'>Object name, Object mixinClass</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'><p>Mixinのプリプロセッサーが内部的に使います。</p> ...</div><div class='long'><p><p>Mixinのプリプロセッサーが内部的に使います。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>mixinClass</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-onConfigUpdate' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-onConfigUpdate' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-onConfigUpdate' class='name expandable'>onConfigUpdate</a>( <span class='pre'>Object names, Object callback, Object scope</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>names</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>callback</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>scope</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-onExtended' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-onExtended' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-onExtended' class='name expandable'>onExtended</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-query' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-query' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-query' class='name expandable'>query</a>( <span class='pre'>Object sql, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL</p>\n\n<p>SQL文を実行します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>sql</span> : Object<div class='sub-desc'><p><p>実行するSQL</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-remove' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-remove' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-remove' class='name expandable'>remove</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>レコード/ドキュメントを削除します。</p> ...</div><div class='long'><p><p>レコード/ドキュメントを削除します。</p>\n\n<p><strong>対象</strong>: MySQL, MongoDB</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p><strong>MySQL</strong>:\nwhere句を入れた文字列、またはキー／値ペアの抽出条件を指定します。</p>\n\n<p><strong>MongoDB</strong>:\nqueryパラメーターを指定します。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-rollback' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-rollback' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-rollback' class='name expandable'>rollback</a>( <span class='pre'>Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL</p>\n\n<p>現在のトランザクションをロールバックします。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-save' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-save' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-save' class='name expandable'>save</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MongoDB</p>\n\n<p>ドキュメントを保存します。コレクションに一致するオブジェクトがあれば更新し、なければ追加します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p>updateコマンドに渡すオブジェクト。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-set' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-set' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-set' class='name expandable'>set</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL</p>\n\n<p>挿入するデータが既にテーブルに存在する場合は、新しくレコードを挿入せず、既存のレコードを新しいデータで上書き（置換）します。\nまた、挿入するデータがテーブルに存在しない場合は、新規レコードを挿入します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p>挿入・または追加するレコードのオブジェクト。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div><div id='method-setConfig' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-setConfig' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-setConfig' class='name expandable'>setConfig</a>( <span class='pre'>Object config, Object applyIfNotSet</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li><li><span class='pre'>applyIfNotSet</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-statics' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-statics' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-statics' class='name expandable'>statics</a>( <span class='pre'></span> ) : <a href=\"#!/api/Ext.Class\" rel=\"Ext.Class\" class=\"docClass\">Ext.Class</a><strong class='protected signature'>protected</strong></div><div class='description'><div class='short'><p>インスタンス化されたオブジェクトの参照を取得します。</p> ...</div><div class='long'><p><p>インスタンス化されたオブジェクトの参照を取得します。</p>\n\n<p><a href=\"#!/api/Ext.Base-property-self\" rel=\"Ext.Base-property-self\" class=\"docClass\" >self</a>\nとは違い、 <code>this.statics()</code>のスコープは独立しています。 実行時の<code>this</code>に関係なく、いつも呼び出されたクラスが返却されます。</p>\n\n<pre><code>Ext.define('My.Cat', {\n    statics: {\n        totalCreated: 0,\n        speciesName: 'Cat' // My.Cat.speciesName = 'Cat'\n    },\n\n    constructor: function() {\n        var statics = this.statics();\n\n        alert(statics.speciesName);     // 'this'の参照先に関係なく常に'Cat'と等しい\n                                        // My.Cat.speciesNameと等価\n\n        alert(this.self.speciesName);   // dependent on 'this'\n\n        statics.totalCreated++;\n    },\n\n    clone: function() {\n        var cloned = new this.self;                      // 'this'に依存する\n\n        cloned.groupName = this.statics().speciesName;   // My.Cat.speciesNameと等価\n\n        return cloned;\n    }\n});\n\n\nExt.define('My.SnowLeopard', {\n    extend: 'My.Cat',\n\n    statics: {\n        speciesName: 'Snow Leopard'     // My.SnowLeopard.speciesName = 'Snow Leopard'\n    },\n\n    constructor: function() {\n        this.callParent();\n    }\n});\n\nvar cat = new My.Cat();                 // alerts 'Cat', then alerts 'Cat'\n\nvar snowLeopard = new My.SnowLeopard(); // alerts 'Cat', then alerts 'Snow Leopard'\n\nvar clone = snowLeopard.clone();\nalert(Ext.getClassName(clone));         // alerts 'My.SnowLeopard'\nalert(clone.groupName);                 // alerts 'Cat'\n\nalert(My.Cat.totalCreated);             // alerts 3\n</code></pre></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Ext.Class\" rel=\"Ext.Class\" class=\"docClass\">Ext.Class</a></span><div class='sub-desc'><p></p>\n</div></li></ul></div></div></div><div id='method-triggerExtended' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-triggerExtended' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-triggerExtended' class='name expandable'>triggerExtended</a>( <span class='pre'>Object config</span> )<strong class='private signature'>private</strong></div><div class='description'><div class='short'> ...</div><div class='long'>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : Object<div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-update' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Ext.app.module.Module'>Ext.app.module.Module</span><br/><a href='source/Module.html#Ext-app-module-Module-method-update' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.app.module.Module-method-update' class='name expandable'>update</a>( <span class='pre'>Object o, Object fn</span> )</div><div class='description'><div class='short'><p>対象: MySQL, MongoDB</p> ...</div><div class='long'><p><p><strong>対象</strong>: MySQL, MongoDB</p>\n\n<p>既存のレコード/ドキュメントを更新します。</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>o</span> : Object<div class='sub-desc'><p><p>更新するオブジェクト。</p>\n\n<p><strong>MySQL</strong>:\n更新するレコードをキー／値ペアで指定します。\n更新の条件は、このオブジェクトの $where キーに設定します。\n条件の指定は、where句を入れた文字列、またはキー／値ペアの抽出条件を指定します。</p>\n\n<p>例</p>\n\n<pre><code>{\n    'name': 'Ext Server',\n    '$where': {\n        id: 1\n    }\n}\n</code></pre>\n\n<p><strong>MongoDB</strong>:\nMongoDBのupdateコマンドに渡すオブジェクト。</p></p>\n</div></li><li><span class='pre'>fn</span> : Object<div class='sub-desc'><p><p>コールバック関数</p></p>\n</div></li></ul></div></div></div></div><div class='subsection'><div class='definedBy'>Defined By</div><h4 class='members-subtitle'>Static Methods</h3><div id='static-method-addMembers' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-addMembers' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-addMembers' class='name expandable'>addMembers</a>( <span class='pre'>Object members</span> )<strong class='static signature'>static</strong></div><div class='description'><div class='short'> ...</div><div class='long'><p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>members</span> : Object<div class='sub-desc'><p></p>\n</div></li></ul></div></div></div><div id='static-method-addStatics' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-addStatics' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-addStatics' class='name expandable'>addStatics</a>( <span class='pre'>Object members</span> ) : <a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a><strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>静的メンバーの追加・上書きをします。</p> ...</div><div class='long'><p><p>静的メンバーの追加・上書きをします。</p>\n\n<pre><code>Ext.define('My.cool.Class', {\n    ...\n});\n\nMy.cool.Class.addStatics({\n    someProperty: 'someValue',      // My.cool.Class.someProperty = 'someValue'\n    method1: function() { ... },    // My.cool.Class.method1 = function() { ... };\n    method2: function() { ... }     // My.cool.Class.method2 = function() { ... };\n});\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>members</span> : Object<div class='sub-desc'><p></p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a></span><div class='sub-desc'><p><p>this</p></p>\n</div></li></ul></div></div></div><div id='static-method-borrow' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-borrow' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-borrow' class='name expandable'>borrow</a>( <span class='pre'><a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a> fromClass, Array/String members</span> ) : <a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a><strong class='private signature'>private</strong><strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>他のクラスのメンバーをこのクラスのプロトタイプに借用します。</p> ...</div><div class='long'><p><p>他のクラスのメンバーをこのクラスのプロトタイプに借用します。</p>\n\n<pre><code>Ext.define('Bank', {\n    money: '$$$',\n    printMoney: function() {\n        alert('$$$$$$$');\n    }\n});\n\nExt.define('Thief', {\n    ...\n});\n\nThief.borrow(Bank, ['money', 'printMoney']);\n\nvar steve = new Thief();\n\nalert(steve.money); // alerts '$$$'\nsteve.printMoney(); // alerts '$$$$$$$'\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>fromClass</span> : <a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a><div class='sub-desc'><p><p>メンバーを借用するクラス。</p></p>\n</div></li><li><span class='pre'>members</span> : Array/String<div class='sub-desc'><p><p>借用するメンバーの名前。</p></p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a></span><div class='sub-desc'><p><p>this</p></p>\n</div></li></ul></div></div></div><div id='static-method-create' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-create' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-create' class='name expandable'>create</a>( <span class='pre'></span> ) : Object<strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>このクラスの新しいインスタンスを生成します。</p> ...</div><div class='long'><p><p>このクラスの新しいインスタンスを生成します。</p>\n\n<pre><code>Ext.define('My.cool.Class', {\n    ...\n});\n\nMy.cool.Class.create({\n    someConfig: true\n});\n</code></pre>\n\n<p>全てのパラメーターはクラスのコンストラクターに渡されます。</p></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p><p>生成されたインスタンス。</p></p>\n</div></li></ul></div></div></div><div id='static-method-createAlias' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-createAlias' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-createAlias' class='name expandable'>createAlias</a>( <span class='pre'>String/Object alias, String/Object origin</span> )<strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>既存のプロトタイプメソッドのエリアスを生成します。</p> ...</div><div class='long'><p><p>既存のプロトタイプメソッドのエリアスを生成します。\n例:</p>\n\n<pre><code>Ext.define('My.cool.Class', {\n    method1: function() { ... },\n    method2: function() { ... }\n});\n\nvar test = new My.cool.Class();\n\nMy.cool.Class.createAlias({\n    method3: 'method1',\n    method4: 'method2'\n});\n\ntest.method3(); // test.method1()\n\nMy.cool.Class.createAlias('method5', 'method3');\n\ntest.method5(); // test.method3() -&gt; test.method1()\n</code></pre></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>alias</span> : String/Object<div class='sub-desc'><p><p>新しいメソッド名、または複数のエリアスを設定するオブジェクト。\n<a href=\"#!/api/Ext.Function-method-flexSetter\" rel=\"Ext.Function-method-flexSetter\" class=\"docClass\" >flexSetter</a>\nを参照。</p></p>\n</div></li><li><span class='pre'>origin</span> : String/Object<div class='sub-desc'><p><p>元のメソッドの名前。</p></p>\n</div></li></ul></div></div></div><div id='static-method-getName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-getName' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-getName' class='name expandable'>getName</a>( <span class='pre'></span> ) : String<strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>現在のクラス名を文字列形式で取得します。</p> ...</div><div class='long'><p><p>現在のクラス名を文字列形式で取得します。</p>\n\n<pre><code>Ext.define('My.cool.Class', {\n    constructor: function() {\n        alert(this.self.getName()); // alerts 'My.cool.Class'\n    }\n});\n\nMy.cool.Class.getName(); // 'My.cool.Class'\n</code></pre></p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p><p>クラス名。</p></p>\n</div></li></ul></div></div></div><div id='static-method-override' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' class='defined-in docClass'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-override' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-override' class='name expandable'>override</a>( <span class='pre'>Object members</span> ) : <a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a><strong class='deprecated signature'>deprecated</strong><strong class='static signature'>static</strong></div><div class='description'><div class='short'><p>プロトタイプメンバーをオーバーライドします。 オーバーライドされたメソッドは、</p> ...</div><div class='long'><p><p>プロトタイプメンバーをオーバーライドします。 オーバーライドされたメソッドは、\n<a href=\"#!/api/Ext.Base-method-callParent\" rel=\"Ext.Base-method-callParent\" class=\"docClass\" >callParent</a>.\nで呼び出すことができます。</p>\n\n<pre><code>Ext.define('My.Cat', {\n    constructor: function() {\n        alert(\"I'm a cat!\");\n    }\n});\n\nMy.Cat.override({\n    constructor: function() {\n        alert(\"I'm going to be a cat!\");\n\n        this.callParent(arguments);\n\n        alert(\"Meeeeoooowwww\");\n    }\n});\n\nvar kitty = new My.Cat(); // alerts \"I'm going to be a cat!\"\n                          // alerts \"I'm a cat!\"\n                          // alerts \"Meeeeoooowwww\"\n</code></pre>\n\n<p>このメソッドを使うことを推奨されません。代わりに\n<a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" class=\"docClass\" >Ext.define</a>\nを使ってください。</p>\n\n<pre><code>Ext.define('My.CatOverride', {\n    override: 'My.Cat',\n    constructor: function() {\n        alert(\"I'm going to be a cat!\");\n\n        this.callParent(arguments);\n\n        alert(\"Meeeeoooowwww\");\n    }\n});\n</code></pre>\n\n<p>上記は同じ目的ですが、\n<a href=\"#!/api/Ext.Loader\" rel=\"Ext.Loader\" class=\"docClass\" >Ext.Loader</a>\nで管理できます。\nLoaderは、対象となるクラスを適切な順番でオーバーライドし、\nビルドプロセスにおいて、対象クラスの依存情報を元にしてどのオーバーラードが必要かを特定することができます。</p></p>\n        <div class='signature-box deprecated'>\n        <p>このメソッドは<strong>非推奨</strong>です </p>\n        <p>{Ext_Base:method-override:deprecated}</p>\n\n        </div>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>members</span> : Object<div class='sub-desc'><p><p>このクラスに追加するプロパティ。\nオブジェクトリテラルで複数のプロパティを指定することもできます。</p></p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" class=\"docClass\">Ext.Base</a></span><div class='sub-desc'><p><p>このクラス。</p></p>\n</div></li></ul></div></div></div></div></div></div></div>","subclasses":[],"requires":[],"mixins":[],"code_type":"ext_define","inheritable":false,"meta":{},"files":[{"href":"Module.html#Ext-app-module-Module","filename":"Module.js"}],"uses":[],"members":{"cfg":[{"owner":"Ext.app.module.Module","meta":{},"tagname":"cfg","name":"autoConnect","id":"cfg-autoConnect"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"cfg","name":"connName","id":"cfg-connName"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"cfg","name":"useTable","id":"cfg-useTable"}],"event":[],"method":[{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"$onExtended","id":"method-S-onExtended"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"addConfig","id":"method-addConfig"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"addInheritableStatics","id":"method-addInheritableStatics"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"addMember","id":"method-addMember"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"beginTrans","id":"method-beginTrans"},{"owner":"Ext.Base","meta":{"protected":true},"tagname":"method","name":"callParent","id":"method-callParent"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"commit","id":"method-commit"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"createCollection","id":"method-createCollection"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"createDatabase","id":"method-createDatabase"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"dropCollection","id":"method-dropCollection"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"dropDatabase","id":"method-dropDatabase"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"end","id":"method-end"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"extend","id":"method-extend"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"find","id":"method-find"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"findAndModify","id":"method-findAndModify"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"getConfig","id":"method-getConfig"},{"owner":"Ext.Base","meta":{},"tagname":"method","name":"getInitialConfig","id":"method-getInitialConfig"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"hasConfig","id":"method-hasConfig"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"implement","id":"method-implement"},{"owner":"Ext.app.module.Module","meta":{"private":true},"tagname":"method","name":"init","id":"method-init"},{"owner":"Ext.Base","meta":{"protected":true},"tagname":"method","name":"initConfig","id":"method-initConfig"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"insert","id":"method-insert"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"mixin","id":"method-mixin"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"onConfigUpdate","id":"method-onConfigUpdate"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"onExtended","id":"method-onExtended"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"query","id":"method-query"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"remove","id":"method-remove"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"rollback","id":"method-rollback"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"save","id":"method-save"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"set","id":"method-set"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"setConfig","id":"method-setConfig"},{"owner":"Ext.Base","meta":{"protected":true},"tagname":"method","name":"statics","id":"method-statics"},{"owner":"Ext.Base","meta":{"private":true},"tagname":"method","name":"triggerExtended","id":"method-triggerExtended"},{"owner":"Ext.app.module.Module","meta":{},"tagname":"method","name":"update","id":"method-update"}],"property":[{"owner":"Ext.Base","meta":{"protected":true},"tagname":"property","name":"self","id":"property-self"}],"css_var":[],"css_mixin":[]},"html_meta":{},"aliases":{},"superclasses":["Ext.Base"],"component":false,"tagname":"class","name":"Ext.app.module.Module","alternateClassNames":[],"inheritdoc":null,"id":"class-Ext.app.module.Module","mixedInto":[],"extends":"Ext.Base"});